package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class NewLoginResponse(	@field:SerializedName("data")	val data: NewLoginData,	@field:SerializedName("meta")	val meta: NewLoginMeta)data class NewUserLogin(	@field:SerializedName("no_tlp")	val noTlp: String,	@field:SerializedName("roles")	val roles: String,	@field:SerializedName("created_at")	val createdAt: String,	@field:SerializedName("email_verified_at")	val emailVerifiedAt: Any,	@field:SerializedName("alamat")	val alamat: String,	@field:SerializedName("password")	val password: String,	@field:SerializedName("photoProfile")	val photoProfile: Any,	@field:SerializedName("updated_at")	val updatedAt: String,	@field:SerializedName("no_bpjs")	val noBpjs: String,	@field:SerializedName("name")	val name: String,	@field:SerializedName("id")	val id: Int,	@field:SerializedName("jenis_kelamin")	val jenisKelamin: String,	@field:SerializedName("email")	val email: String)data class NewLoginMeta(	@field:SerializedName("code")	val code: Int,	@field:SerializedName("message")	val message: String,	@field:SerializedName("status")	val status: String)data class NewLoginData(	@field:SerializedName("access_token")	val accessToken: String,	@field:SerializedName("token_type")	val tokenType: String,	@field:SerializedName("user")	val user: NewUserLogin)